export default class Utils {
   static uniqueId () {
    return '_' + Math.random().toString(36).substr(2, 9);
   }
   copy(origin){
      return Object.assign({}, origin)
   }
   merge(first, second){
      return Object.assign({}, first, second);
   }
}
